import React, { useContext } from 'react';
import { useParams } from 'react-router-dom';
import UserContext from '../utils/UserContext';


const Set =  () => {
    const { id } = useParams()
    const { request } = useContext(UserContext)

    const getSet = async (id) => {
        const set = await request(`sets/${id}`)
        return set
    }

    console.log(getSet(id))
    // get set with that id
    // informational card on top
    // map flashcards into cards
    return (
        <h1> {id} </h1>
    )
}

export default Set;
